export var VpsVersion;
(function (VpsVersion) {
    VpsVersion[VpsVersion["1.0"] = 1] = "1.0";
    VpsVersion[VpsVersion["2.0"] = 2] = "2.0";
    VpsVersion[VpsVersion["3.0"] = 3] = "3.0";
    VpsVersion[VpsVersion["4.0"] = 4] = "4.0";
    VpsVersion[VpsVersion["5.0"] = 5] = "5.0";
})(VpsVersion || (VpsVersion = {}));
